import React from "react";
import PropTypes from "prop-types"; 

function Note({ title, content }) { 
    return (
        <div className="note">
            <h1>{title}</h1>
            <p>{content}</p>
            <button>DELETE</button>
        </div>
     
    );
}


Note.propTypes = {
    title: PropTypes.string.isRequired, 
    content: PropTypes.string.isRequired 
};

export default Note;
